from django.db import models
import time


# Create your models here.

def getMessageNum():
    """
    获取消息的号码
    :return:
    """
    timestamp = str(int(time.time() * 1000))  # 13位长度,都是时间戳
    return "MN" + timestamp


class Message(models.Model):
    """
    消息
    """
    message_num = models.CharField(default=getMessageNum, max_length=16, help_text="消息") # 注意：message_num 相同，说明是同一次发送

    title = models.CharField(max_length=64, help_text="消息名称")
    content = models.CharField(max_length=1024, help_text="消息内容")

    is_read = models.DateTimeField(null=True, blank=True,help_text="消息是否已经读过,以及读的日期")

    create_user = models.ForeignKey(AuthUser, on_delete=models.DO_NOTHING, related_name="created_messages",help_text="创建者")
    receive_user = models.ManyToManyField(AuthUser, related_name="received_messages", help_text="接受者")

    ctime = models.DateTimeField(auto_now_add=True, help_text="创建日期")
    uptime = models.DateTimeField(auto_now=True, help_text="更新日期")

    def __str__(self):
        return self.title
    def __unicode__(self):
        return self.title




